import React, { Fragment } from "react";
import Tour from './Tour'
import { Container, Row, Col } from "react-bootstrap";

const Tours = ({ tours }) => {
    return (
        <Fragment>
            <Container>
                <div>OUR TOURS</div>
                    {tours.map((tour) => {
                        return <Tour key={tour.id} {...tour}></Tour>
                    })}
            </Container>
        </Fragment>

    );
};

export default Tours;
